%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
function [Jabp]=xyz2cam02ucs(XYZ,XYZW,Yb,Did,F,Nc,c,LA)
% setup the CAT02 matrix:
MCAT02=[ 0.7328, 0.4296, -0.1624;
        -0.7036, 1.6975, 0.0061;
        0.0030,  0.0136, 0.9834];
    
% set up the inverse of MCAT02:
INVMCAT02=  inv(MCAT02);
       
%setup the HPE matrix
MHPE=[ 0.38971,  0.68898,  -0.07868;
      -0.22981,  1.18340,   0.04641;
      0.00000,  0.0000,     1.00000];

% setup matrix to convert from CAM02 responses to HPE cone responses:
MHPEinvCAT02 = MHPE*INVMCAT02;
  
% calculate general parameters:
k=1/(5*LA+1);
FL=0.2*(k^4)*(5*LA) + 0.1*( (1-k^4)^2 )*(5*LA)^(1/3);
n=Yb/XYZW(2);
z=1.48+n^0.5;
Nbb=0.725*(1/n)^0.2;
Ncb=Nbb;



% step 1: calculate CAT02-sensor responses:
RGBW=MCAT02*XYZW';
RGB=MCAT02*XYZ';

% step 2: apply CAT to sensor responses:
if Did==1
    D=1;
else
    if Did <=1;D=abs(Did);else;D=F*(1-exp(-(LA+42)/92)/3.6);end
    
end
DRGB=inv( diag(RGBW) )*ones(3,1)*(D*XYZW(2))  +  (1-D)*ones(3,1);

RGBC=diag(DRGB)*RGB;
RGBWC=diag(DRGB)*RGBW;

% step 3: convert back to XYZ and then to HPE cone responses:
RGB1=MHPEinvCAT02*RGBC;
RGBW1=MHPEinvCAT02*RGBWC;

% step 4: apply luminance adaptation:
lumadap = @(x,FL) ((400.*(FL.*x./100).^0.42)./(27.13+(FL.*x./100).^0.42))+0.1;
RGBA1=lumadap(RGB1,FL);
RGBAW1=lumadap(RGBW1,FL);

% step 5:  calculate opponent signals a and b:
a=RGBA1(1,:)-12*RGBA1(2,:)/11+RGBA1(3,:)/11;
b=(RGBA1(1,:)+RGBA1(2,:)-2*RGBA1(3,:))/9;

% step 6: calculate achromatic signals A:
ca=[2 1 1/20];
A=Nbb*(ca*RGBA1 - 0.305);
AW=Nbb*(ca*RGBAW1 - 0.305);

% step 6: calculate hue h: 
h=HueAngle(a,b);

% step 7: calculate J:
J = 100.*(A./AW).^(c.*z);


% step 8: calculate colorfulness:
et = (1/4).*(cos(h.*pi./180 + 2)+3.8);
t = ((50000/13).*Ncb.*Nc.*et.*sqrt(a.^2+b.^2))./(RGBA1(1,:)+RGBA1(2,:)+(21./20).*RGBA1(3,:));
C = (t.^0.9).*sqrt(J./100).*(1.64-0.29.^n).^0.73;
M = C.*FL.^0.25;

% Convert CIECAM02 J, M, h to CAM02-UCS J',a',b':
Jp=(1+100*0.007)*J./(1+0.007*J);
Mp=(1/0.0228)*log(1+0.0228*M);
ap=Mp.*cos(h*pi/180);
bp=Mp.*sin(h*pi/180);
Jabp=[Jp',ap',bp'];
end

%--------------------------------------------------------------------------
function h=HueAngle(a,b)
% hue angle calculation for given a and b:  a  horizontal axis, and b the vertical axis
% a and b can be vector. In this case, h is also a vector.
% if a and b are row vector, then h is row vector, and a and b are column
% vectors, then h is column vector too.
h=atan2(b,a)*180/pi;
s1=h<0;
s2=h>=0;
h1=(h+360).*s1;
h2=h.*s2;
h=h1+h2;
end
