            ColourTemp=ColourTemp193102;
        case 1931
            ColourTemp=ColourTemp193102;
        case 10
            ColourTemp=ColourTemp196410;
        case 1964
            ColourTemp=ColourTemp196410;
   
    end

    %initialize for speed
    CCT_out = nan(1,size(XYZWT_,1));
    duv_out = CCT_out;
    for i = 1:size(XYZWT_,1)
        XYZWT = XYZWT_(i,:);

        ut=4*XYZWT(1)/(XYZWT(1)+15*XYZWT(2)+3*XYZWT(3));
        vt=6*XYZWT(2)/(XYZWT(1)+15*XYZWT(2)+3*XYZWT(3));

        dc=((ut-ColourTemp(:,2)).^2+(vt-ColourTemp(:,3)).^2).^0.5;
        if ~isnan(min(dc))
            eps=1e-10;
            q=find((dc>=min(dc)-eps) &(dc<=min(dc)+eps));
            q=q(1);
            vr=ColourTemp(q,3);
            Tm=ColourTemp(q,1);
            dm=dc(q);

            %for Tm > 50000 --> increase ColourTemp resolution by linear
            %interpolation:
            Tmax = 50000;
            if (Tm>=Tmax)
                warning('CCT too large (> 50000 K) to determine from LUT.')
                [CCT,duv]=xyz2CCT(XYZWT,obs);

            else

                if Tm~=ColourTemp(end,1);
                    T1=ColourTemp(q+1,1);
                    d1=dc(q+1);
                    u1=ColourTemp(q+1,2);
                    v1=ColourTemp(q+1,3);
