                    T0=ColourTemp(q,1);
                    d0=dc(q);
                    u0=ColourTemp(q,2);
                    v0=ColourTemp(q,3);
                end

                a=d0/(T0-Tm)/(T0-T1);
                b=dm/(Tm-T0)/(Tm-T1);
                c=d1/(T1-T0)/(T1-Tm);
                A=a+b+c;
                B=-(a*(T1+Tm)+b*(T0+T1)+c*(Tm+T0));
                C=a*Tm*T1+b*T0*T1+c*T0*Tm;
                Tp=-B/(2*A);
                duv=(A*Tp^2+B*Tp+C);
                
                try    
                    signduv=checkduvsign([ut,vt],ColourTemp([q-1,q,q+1],2:3));%fastest
                catch
                    signduv=1;
                end
                duv=signduv(1).*duv;

